import { React, useContext} from 'react'
import { ThemeContext } from '../context/ThemeContext'

const Title = ({ content }) => {

  const title = useContext(ThemeContext)

  return (
    <>
     <h1 className={title ? `` : ``}>{content}</h1> 
    </>
  )
}

export default Title
